import React from 'react'
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import MatchForm from './MatchForm';

const Admin = () => {
  return (
        
      <div className="container py-3">
        {/* Simple Navbar */}
        <nav className="mb-4">
          <Link to="/" className="btn btn-outline-success me-2">Matches</Link>
          <Link to="/add" className="btn btn-outline-primary">Add Match</Link>
          <MatchForm />
        </nav>
    </div>
  )
}

export default Admin
